import React from 'react';

function Logged(){
    async function get() {
        const response = await fetch('/api/logincookie', {
            method: "GET",
            headers: {
                'Content-type': 'application/json'
            }
        })
        const data = await response.json()
        return data
    }
    get().then(res => console.log(res))

    return <p>fodase</p>
}

export default Logged
